create or replace table student_table (
	student_id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	age INT,
	email VARCHAR(50),
	country VARCHAR(50),
	postal_code VARCHAR(50),
	major VARCHAR(23),
	gpa DECIMAL(3,2),
	entry_date varchar(20),
	generation INT,
	recent_activity TIMESTAMP WITH TIME ZONE,
	recent_activity_unix INT
);


